  /**
   * 渲染 PSD JSON 图层到 Canvas
   */
  function renderLayers() {
    try {
      // 1. 获取输入的 JSON 数据和图片路径
      const jsonStr = document.getElementById('jsonInput').value.trim()
      const imagePath = document.getElementById('imagePath').value.trim()
      if (!jsonStr) {
        alert('请粘贴 PSD JSON 数据！')
        return
      }
      if (!imagePath) {
        alert('请输入智能对象图片路径！')
        return
      }

      // 2. 解析 JSON
      const psdData = JSON.parse(jsonStr)
      const doc = psdData.document
      const layers = psdData.layers.filter(layer => layer.visible) // 只渲染可见图层
      if (layers.length === 0) {
        alert('没有可见图层可渲染！')
        return
      }

      // 3. 初始化 Canvas（按 PSD 尺寸缩放，避免过大）
      const canvas = document.getElementById('renderCanvas')
      const ctx = canvas.getContext('2d')

      // 缩放因子：PSD 可能很大（如 8000x8000），缩小到浏览器可显示尺寸
      // const scaleFactor = Math.min(1, window.innerWidth * 0.8 / doc.width, window.innerHeight * 0.8 / doc.height);
      const scaleFactor = 1
      canvas.width = doc.width * scaleFactor
      canvas.height = doc.height * scaleFactor

      // 4. 加载智能对象图片并渲染每个图层
      layers.forEach(layer => {
        const fn = (layer) => {
          if (layer.children?.length) {
            layer.children.map(item => {
              fn(item)
            })
            return
          }
          if (layer.type !== 'SmartObject') {
            console.warn(`跳过非智能对象图层：${layer.name}`)
            return
          }

          const img = new Image()
          img.crossOrigin = 'anonymous' // 解决跨域图片问题
          img.onload = function () {
            // 保存当前绘图状态
            ctx.save()

            // 5. 应用图层变换（位移、旋转、缩放）
            const bounds = layer.bounds
            const originalSize = layer.smartObject.originalSize
            const currentSize = layer.smartObject.currentSize
            const smartObject = layer.smartObject
            let corners = smartObject.corners
            const transform = smartObject.transform
            const { center } =  getOriginalPoints([corners.topLeft, corners.topRight, corners.bottomRight, corners.bottomLeft], transform.rotation)
            const centerX = center.x * scaleFactor // 图层中心点（缩放后）
            const centerY = center.y * scaleFactor

            // 步骤1：平移到图层中心点（旋转/缩放的基准点）
            ctx.translate(centerX, centerY)
            if(transform.flipHorizontal || transform.flipVertical) {
              const flipX = transform.flipHorizontal ? -1 : 1
              const flipY = transform.flipVertical ? -1 : 1
              ctx.scale(flipX, flipY)
            }



            // 步骤3：缩放（JSON 中 scaleX/scaleY 为百分比，需除以 100）
            const scaleX = transform.scaleX / 100
            const scaleY = transform.scaleY / 100
            ctx.scale(scaleX, scaleY)
                // 步骤2：旋转（角度转弧度，PS 旋转方向为顺时针）
            const rotationRad = (transform.rotation * Math.PI) / 180
            ctx.rotate(rotationRad)
            // ctx.translate(-centerX, -centerY)
            // ctx.translate(bounds.centerX * scaleFactor, bounds.centerY * scaleFactor)
            let drawWidth = originalSize.width * scaleFactor
            let drawHeight = originalSize.height * scaleFactor
            // 步骤4：平移回图层原始位置（基于左上角）
            const afterRotatedSize = getRotatedImageSize(drawWidth, drawHeight, transform.rotation)
            // ctx.translate(x, y)
            ctx.translate(-drawWidth / 2, -drawHeight / 2)
            // ctx.translate(-afterRotatedSize.width/2, -afterRotatedSize.height/2)
            // 6. 设置透明度（0-100 转 0-1）
            ctx.globalAlpha = layer.opacity / 100

            // 7. 绘制智能对象图片（按当前尺寸渲染）

            ctx.drawImage(
              img,
              0, 0, // 图片起始位置
              img.width, img.height, // 图片原始尺寸
              0, 0, // Canvas 绘制起始位置
              drawWidth, drawHeight // Canvas 绘制尺寸（当前尺寸）
            )

            // 恢复绘图状态（不影响其他图层）
            ctx.restore()

            console.log(`✅ 渲染完成：${layer.name}`)
          }

          img.onerror = function () {
            alert(`加载图片失败：${imagePath}\n请检查图片路径是否正确！`)
          }

          // 加载图片（替换为实际智能对象图片路径）
          // img.src = imagePath;
          img.src = base64
        }
        fn(layer)
      })

    } catch (e) {
      alert(`渲染失败：${e.message}`)
      console.error('渲染错误：', e)
    }
  }

  function getRotatedImageSize(originW, originH, angle = 30, scale = 1) {
    const rad = (angle * Math.PI) / 180 // 角度转弧度
    const scaledW = originW * scale
    const scaledH = originH * scale
    // 核心公式
    const width = Math.round(Math.abs(scaledW * Math.cos(rad)) + Math.abs(scaledH * Math.sin(rad)))
    const height = Math.round(Math.abs(scaledW * Math.sin(rad)) + Math.abs(scaledH * Math.cos(rad)))
    return { width, height }
  }


  function getOriginalPoints(rotatedPoints, angle) {
    // 步骤1：计算旋转后的中心点（旋转前后不变）
    const Cx = rotatedPoints.reduce((sum, p) => sum + p.x, 0) / 4;
    const Cy = rotatedPoints.reduce((sum, p) => sum + p.y, 0) / 4;
    const center = { x: Cx, y: Cy };

    // 步骤2：角度转弧度（逆旋转角度为 -angle）
    const theta = angle * Math.PI / 180; // 正向旋转角度（弧度）
    const cosθ = Math.cos(theta);
    const sinθ = Math.sin(theta);

    // 步骤3：对每个旋转后的点，执行逆旋转变换
    const originalPoints = rotatedPoints.map(point => {
      const xPrime = point.x;
      const yPrime = point.y;

      // 计算相对于中心点的偏移量
      const dx = xPrime - Cx;
      const dy = yPrime - Cy;

      // 逆旋转公式：还原原始坐标
      const x = dx * cosθ + dy * sinθ + Cx;
      const y = -dx * sinθ + dy * cosθ + Cy;

      // 保留2位小数（避免浮点数误差）
      return { x: Math.round(x * 100) / 100, y: Math.round(y * 100) / 100 };
    });

    return { originalPoints, center };
  }




  // 页面加载完成后自动渲染（可选）
  // window.onload = renderLayers;
</script>
